import React, { Component } from 'react';
import { Link } from 'react-router-dom';
import axios from 'axios'; 

export default class RecommendExercises extends Component {
    constructor(props) {
        super(props);

    }

    render() {
        return (
            <div>
                <h3>Recommended Exercises</h3>
                <h4><Link to="/cycling" >Cycling</Link></h4>
                <li><Link to="/planks">Planks</Link></li>
                // <Link to="/Push ups">Push ups</Link>
                // <Link to="/recommendation" className="nav-link">Recommended Exercises</Link>
            </div>
        )
    }
}
